const SideBar = () => {
    return (
        <div className="menu">
            <div className="logo">Logo</div>
            <div className="menu-item">
                Search
            </div>

            <style jsx>{`
                .menu {
                    position: relative;
                    height: 100%;
                    width: 100%;
                    padding: 10px;
                    background: #281742;
                }

                .menu-item {
                    padding: 5px;
                    color: #d0bff2;
                    cursor: pointer;
                    font-size: 15px;
                }

                .menu-item:hover {
                    background: #716ad4;
                    border-radius: 4px;
                    font-weight: bold;
                    color: white;
                }

                .logo {
                    margin-bottom: 100px;
                }
            `}</style>
        </div>
    )
}

export default SideBar
